$(document).ready(function(){
    for(mapName in derivedMapDefs){
        var mapDef = derivedMapDefs[mapName];
        jvm.WorldMap.maps[mapName] = $.extend(true, {}, jvm.WorldMap.maps[mapDef.derivedFrom]);
        var newMap = jvm.WorldMap.maps[mapName];
        for(var i=0;i<mapDef.regions.length;i++){
            var regionDef = mapDef.regions[i];
            //console.info("'"+regionDef.code+"',");
            //console.info("insert into geographies (name, keywords, iso3166, regexes, jvectormap) values('"+regionDef.name+"','"+regionDef.name+"','"+regionDef.components.join("+")+"','/b"+regionDef.name+"/b','"+regionDef.code+"');");
            var iso = regionDef.components.join("+");
            iso = iso.replace(/US-/g,"USA-");
            console.info("insert into mapgeographies (select '"+mapName+"',geoid from geographies where iso3166 ='"+iso+"')");
            newMap.paths[regionDef.code] = {name: regionDef.name, path: ""};
            for(var j=0;j<regionDef.components.length;j++){
                if(newMap.paths[regionDef.components[j]]){
                    newMap.paths[regionDef.code].path += (j==0?'':' ') + newMap.paths[regionDef.components[j]].path;
                } else {
                    //console.info(regionDef.components[j]+' not found in '+mapDef.derivedFrom);
                }
                delete newMap.paths[regionDef.components[j]];
            }
        }
    }

    for(mapName in derivedMapDefs){
        $("#"+mapName).vectorMap({map: mapName});
        var jvMap = jvm.WorldMap.maps[mapName];
        var fo = {insets: jvMap.insets, width: jvMap.width, width: jvMap.width, projection: jvMap.projection, paths: jvMap.paths};
        var newMapFile = "$.fn.vectorMap('addMap', '"+mapName+"', "+JSON.stringify(fo)+");";
        console.log(newMapFile);
    }
});
